const App = () => {

  return (
    <div>
    <h1>Fremtidsmat</h1>
    <select class="form-select form-select-lg mb-3" aria-label=".form-select-lg example">
      <option selected>Open this select menu</option>
      <option value="1">One</option>
      <option value="2">Two</option>
      <option value="3">Three</option>
    </select>
    </div>
  )
};



export default App;
